import{_ as e}from"./chunks/pixhawk_v6x.CLqvvgiD.js";import{_ as a,a as r}from"./chunks/core.vaKwc9xW.js";import{_ as i}from"./chunks/pixhawk_v6x_pinouts.BSlXeHIR.js";import{_ as o,c as l,a8 as n,o as s}from"./chunks/framework.BDnHobkS.js";const k=JSON.parse('{"title":"CUAV Pixhawk V6X","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/cuav_pixhawk_v6x.md","filePath":"en/flight_controller/cuav_pixhawk_v6x.md"}'),d={name:"en/flight_controller/cuav_pixhawk_v6x.md"};function p(h,t,u,c,m,b){return s(),l("div",null,t[0]||(t[0]=[n('<h1 id="cuav-pixhawk-v6x" tabindex="-1">CUAV Pixhawk V6X <a class="header-anchor" href="#cuav-pixhawk-v6x" aria-label="Permalink to &quot;CUAV Pixhawk V6X&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><em>Pixhawk V6X</em><sup>®</sup> is the latest update to the successful family of Pixhawk® flight controllers designed and made in collaboration with CUAV<sup>®</sup> and the PX4 team.</p><p>It is based on the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-012%20Pixhawk%20Autopilot%20v6X%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk​​® Autopilot FMUv6X Standard</a>, <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-010%20Pixhawk%20Autopilot%20Bus%20Standard.pdf" target="_blank" rel="noreferrer">Autopilot Bus Standard</a>, and <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Connector Standard</a>.</p><p><img src="'+e+'" alt="Pixhawk V6X"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This autopilot is <a href="./../flight_controller/autopilot_pixhawk_standard.html">supported</a> by the PX4 maintenance and test teams.</p></div><p>Pixhawk<sup>®</sup> V6X brings you the ultimate in performance, stability and reliability in all aspects.</p><ul><li>Arm® Cortex®-M7 processor (STM32H753) with Floating Point Unit (FPU), 480MHz high-speed operations and 2MB flash. Developers can be more productive and efficient, allowing for more complex algorithms and models.</li><li>High-performance on-board, low-noise IMU and automotive-grade magnetic compass based on FMUv6X open standard. It aims to achieve better stability and anti-interference ability.</li><li>Triple redundant IMU &amp; double redundant barometer on separate buses. When the PX4 Autopilot detects a sensor failure, the system seamlessly switches to another to maintain flight control reliability.</li><li>An independent LDO powers every sensor set with independent power control. A vibration isolation System to filter out high-frequency vibration and reduce noise to ensure accurate readings, allowing vehicles to reach better overall flight performances.</li><li>External sensor bus (SPI5) has two chip select lines and data-ready signals for additional sensors and payload with SPI-interface.</li><li>Integrated Microchip Ethernet PHY for high-speed communication over Ethernet with onboard devices such as mission computers.</li><li>Newly designed vibration isolation system to filter out high frequency vibration and reduce noise to ensure accurate readings.</li><li>IMUs are temperature-controlled by onboard heating resistors, allowing optimum working temperature of IMUs </li><li>Modular flight controller: separated IMU, FMU, and Base system connected by a 100-pin &amp; a 50-pin Pixhawk®​ Autopilot Bus connector.</li></ul><p>The Pixhawk® V6X is ideal for corporate research labs, academic research and commercial applications.</p><h3 id="processors-sensors" tabindex="-1">Processors &amp; Sensors <a class="header-anchor" href="#processors-sensors" aria-label="Permalink to &quot;Processors &amp; Sensors&quot;">​</a></h3><ul><li>FMU Processor: STM32H753 <ul><li>32 Bit Arm® Cortex®-M7, 480MHz, 2MB flash memory, 1MB RAM</li></ul></li><li>IO Processor: STM32F103 <ul><li>32 Bit Arm® Cortex®-M3, 72MHz, 20KB SRAM</li></ul></li><li>On-board sensors <ul><li>Accel/Gyro: BMI088</li><li>Accel/Gyro: ICM-42688-P</li><li>Accel/Gyro: ICM-20649</li><li>Mag: RM3100</li><li>Barometer: 2x ICP-20100</li></ul></li></ul><h3 id="electrical-data" tabindex="-1">Electrical data <a class="header-anchor" href="#electrical-data" aria-label="Permalink to &quot;Electrical data&quot;">​</a></h3><ul><li>Voltage Ratings: <ul><li>Max input voltage: 5.7V</li><li>USB Power Input: 4.75~5.25V</li><li>Servo Rail Input: 0~9.9V</li></ul></li><li>Current Ratings: <ul><li>TELEM1 and GPS2 combined output current limiter: 1.5A</li><li>All other port combined output current limiter: 1.5A</li></ul></li></ul><h3 id="interfaces" tabindex="-1">Interfaces <a class="header-anchor" href="#interfaces" aria-label="Permalink to &quot;Interfaces&quot;">​</a></h3><ul><li>16- PWM servo outputs</li><li>1 Dedicated R/C input for Spektrum / DSM and S.Bus with analog / PWM RSSI input</li><li>3 TELEM Ports（with full flow control）</li><li>1 UART4(Seial and I2C)</li><li>2 GPS ports <ul><li>1 full GPS plus Safety Switch Port(GPS1)</li><li>1 basic GPS port(with I2C,GPS2)</li></ul></li><li>2 USB Ports <ul><li>1 TYPE-C</li><li>JST GH1.25</li></ul></li><li>1 Ethernet port <ul><li>Transformerless Applications</li><li>100Mbps</li></ul></li><li>1 SPI bus <ul><li>2 chip select lines</li><li>2 data-ready lines</li><li>1 SPI SYNC line</li><li>1 SPI reset line</li></ul></li><li>2 CAN Buses for CAN peripheral <ul><li>CAN Bus has individual silent controls or ESC RX-MUX control</li></ul></li><li>4 power input ports <ul><li>2 Dronecan/UAVCAN power inputs</li><li>2 SMBUS/I2C power inputs</li></ul></li><li>1 AD &amp; IO port <ul><li>2 additional analog input(3.3 and 6.6v）</li><li>1 PWM/Capture input</li></ul></li><li>2 Dedicated debug <ul><li>FMU debug</li><li>IO debug</li></ul></li></ul><h3 id="mechanical-data" tabindex="-1">Mechanical data <a class="header-anchor" href="#mechanical-data" aria-label="Permalink to &quot;Mechanical data&quot;">​</a></h3><ul><li><p>Weight</p><ul><li>Flight Controller Module: 99g</li><li>Core module: 43g</li><li>Baseboard: 56g</li></ul></li><li><p>Operating &amp; storage temperature: -20 ~ 85°c</p></li><li><p>Size</p><ul><li><p>Flight controller</p><p><img src="'+a+'" alt="Pixhawk V6X"></p></li><li><p>Core module</p><p><img src="'+r+'" alt="Pixhawk V6X"></p></li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Order from <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">CUAV</a>.</p><h2 id="assembly-setup" tabindex="-1">Assembly/Setup <a class="header-anchor" href="#assembly-setup" aria-label="Permalink to &quot;Assembly/Setup&quot;">​</a></h2><p>The <a href="./../assembly/quick_start_cuav_pixhawk_v6x.html">Pixhawk V6X Wiring Quick Start</a> provides instructions on how to assemble required/important peripherals including GPS, Power Module etc.</p><h2 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h2><p><img src="'+i+'" alt="Pixhawk V6x Pinout"></p><p>Notes:</p><ul><li>The <a href="./../camera/fc_connected_camera.html#camera-capture-configuration">camera capture pin</a> (<code>PI0</code>) is pin 2 on the AD&amp;IO port, marked above as <code>FMU_CAP1</code>.</li></ul><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM3</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>Debug Console</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>UART4</td></tr><tr><td>UART5</td><td>/dev/ttyS4</td><td>TELEM2</td></tr><tr><td>USART6</td><td>/dev/ttyS5</td><td>PX4IO/RC</td></tr><tr><td>UART7</td><td>/dev/ttyS6</td><td>TELEM1</td></tr><tr><td>UART8</td><td>/dev/ttyS7</td><td>GPS2</td></tr></tbody></table><h2 id="voltage-ratings" tabindex="-1">Voltage Ratings <a class="header-anchor" href="#voltage-ratings" aria-label="Permalink to &quot;Voltage Ratings&quot;">​</a></h2><p><em>Pixhawk V6X</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWERC1/POWER1</strong>, <strong>POWERC2/POWER2</strong> and <strong>USB</strong>.</p><ul><li><strong>POWER C1</strong> and <strong>POWER C2</strong> are DroneCAN/UAVCAN battery interfaces (recommended)；<strong>POWER1</strong> and <strong>POWER2</strong> are SMbus/I2C battery interfaces (backup).</li><li><strong>POWER C1</strong> and <strong>POWER1</strong> use the same power switch, <strong>POWER C2</strong> and <strong>POWER2</strong> use the same power switch.</li></ul><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><strong>POWER C1</strong>, <strong>POWER C2</strong>, <strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.75V to 5.7V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>Under these conditions the system will not draw any power (will not be operational), but will remain intact.</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (operational range 4.7V to 5.7V, 0V to 10V undamaged)</li><li><strong>USB input</strong> (operational range 4.7V to 5.7V, 0V to 6V undamaged)</li><li><strong>Servo input:</strong> <code>VDD_SERVO</code> pin of <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 42V undamaged)</li></ol><p><strong>Voltage monitoring</strong></p><p>Digital DroneCAN/UAVCAN battery monitoring is enabled by default (see <a href="./../assembly/quick_start_cuav_pixhawk_v6x.html#power">Quickstart &gt; Power</a>).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Analog battery monitoring via an ADC is not supported on this particular board, but may be supported in variations of this flight controller with a different baseboard.</p></div><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v6x_default</span></span></code></pre></div><p><a id="debug_port"></a></p><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> run on the <strong>FMU Debug</strong> port.</p><p>The pinouts and connector comply with the <a href="./../debug/swd_debug.html#pixhawk-debug-full">Pixhawk Debug Full</a> interface defined in the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> interface (JST SM10B connector).</p><table tabindex="0"><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td><code>Vtref</code></td><td>+3.3V</td></tr><tr><td>2 (blk)</td><td>Console TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>Console RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td><code>SWDIO</code></td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td><code>SWCLK</code></td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td><code>SWO</code></td><td>+3.3V</td></tr><tr><td>7 (blk)</td><td>NFC GPIO</td><td>+3.3V</td></tr><tr><td>8 (blk)</td><td>PH11</td><td>+3.3V</td></tr><tr><td>9 (blk)</td><td>nRST</td><td>+3.3V</td></tr><tr><td>10 (blk)</td><td><code>GND</code></td><td>GND</td></tr></tbody></table><p>For information about wiring and using this port see:</p><ul><li><a href="./../debug/system_console.html#pixhawk_debug_port">PX4 System Console</a> (Note, the FMU console maps to USART3).</li><li><a href="./../debug/swd_debug.html">SWD Debug Port</a></li></ul><h2 id="peripherals" tabindex="-1">Peripherals <a class="header-anchor" href="#peripherals" aria-label="Permalink to &quot;Peripherals&quot;">​</a></h2><ul><li><a href="https://holybro.com/products/digital-air-speed-sensor" target="_blank" rel="noreferrer">Digital Airspeed Sensor</a></li><li><a href="https://holybro.com/collections/telemetry-radios?orderby=date" target="_blank" rel="noreferrer">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="further-info" tabindex="-1">Further info <a class="header-anchor" href="#further-info" aria-label="Permalink to &quot;Further info&quot;">​</a></h2><ul><li><a href="https://doc.cuav.net/" target="_blank" rel="noreferrer">CUAV Docs</a> (CUAV)</li><li><a href="./../assembly/quick_start_cuav_pixhawk_v6x.html">Pixhawk V6X Wiring QuickStart</a></li><li><a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-012%20Pixhawk%20Autopilot%20v6X%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Autopilot FMUv6X Standard</a></li><li><a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-010%20Pixhawk%20Autopilot%20Bus%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Autopilot Bus Standard</a></li><li><a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a></li></ul>',56)]))}const S=o(d,[["render",p]]);export{k as __pageData,S as default};
